//SPDX-License-Identifier: MIT
pragma solidity ^ 0.8.13;

library Math{ //keyword library is uesd to create a library 
//creating a library to do calculations here 

  function sqrt(uint y) internal pure returns(uint z){
    if(y > 3){
      z = y;
      uint x = y / 2 + 1;

      while(x < z){
        z = x;
        x = (y / x + x) / 2;
      }
    }else if(y != 0){
      z = 1;
    }
    //else z = 0 : default value 
  }

}

contract TestMath{
  function testSquareRoot(uint x) public pure returns(uint){
    return Math.sqrt(x);
  }
}

//array function to delete ememt at index and re-organize the array
//so that there are no gaps between the elements
library Array{
  function remove(uint[] storage arr, uint index) public{  //storage used cause its going to directly manipulate the state variables 
    //move the last elemtninto the place of deleted index
    require(arr.length > 0, "CAnt remove from an empty array");
    arr[index] = arr[arr.length - 1];
    arr.pop();
  }
}

contract TestArray{
  using Array for uint[]; //initialize library by using the using keyword
  uint[] public arr;
  function testArrayRemove() public{
    for (uint i = 0; i < 3; i++){
      arr.push(i);
    }

    arr.remove(1);

    assert(arr.length == 2);
    assert(arr[0] == 0);
    assert(arr[1] == 2);
  }
}

